Wikipèdia bahsa Acèh Wikipèdia bahsa Acèh nakeuh ènsiklopèdia online lam bahsa Acèh nyang geupeuseudiya lé Wikipèdia. Uroe jeuet Wikipèdia bahsa Acèh[andam | andam nè] Wikipèdia bahsa Acèh na bak uroe 12 Buleuen Lapan 2009. Haba nyoe laju geuteurimöng lé Fadli Idris nyang bak watèe nyan gobnyan seubagoe Koordinator Komunitas Blogger Aceh (kayém geukheun Aceh Blogger Community). Yôh mantöng lam inkubator, Fadli geupeukeumang Wikipèdia nyoe ngön sidroe ureueng ngui la'én nyang geungui nan Si Gam A
..........
] Bak awai thôn 2009, Abi Azkia, nyang sidroe ureueng peurunoe 'èleumèe agama di da'irah Pidie geupeuramèe Wikipèdia bahsa Acèh. Abi geubantu teumuléh teunuléh-teunuléh bhaih agama Islam.[2] Lam teunuléh gobnyan bak Serambi Indonesia, Abi geupeutrang pakön payah bak tateumuléh lam bahsa Acèh.[3] Abi geupeugah meunyoe bahsa Acèh na bida bak kri teumuléh. La'én nibak nyan, bahsa Acèh nyang geungui cingkunèk cit jeuet keu saboh masalah. Kureung le jeumeulah kata lam bahsa Acèh nyang geuteupeu ngön
